import React from "react";
import "../styles/home.css";
import { Container, Row, Col } from "reactstrap";
import { heroImg, heroImg02, heroVideo, worldImg } from "../assets/images";
import SubTitle from "../shared/SubTitle.jsx";

const Home = () => {
  return (
    <>
      {/*//! ============= HERO SECTION START ============= */}
      <section>
        <Container>
          <Row>
            <Col lg="6">
              <div className="hero__content">
                <div className="hero__subtitle d-flex align-items-center">
                  <SubTitle subtitle={"Know Before You Go"} />
                  <img src={worldImg} alt="hero-img" />
                </div>
                <h1>
                  Traveling opens the door to creating
                  <span className="highlight">memories</span>
                </h1>
                <p>
                  Lorem ipsum dolor, sit amet consectetur adipisicing elit.
                  Veniam, hic. Laboriosam quis, quos quia, dolorem quas ipsam
                  temporibus voluptates ab laudantium corporis recusandae,
                  cumque perferendis non quasi unde! Nam, libero.
                </p>
              </div>
            </Col>
            <Col lg="2">
              <div className="hero__img-box"></div>
            </Col>
          </Row>
        </Container>
      </section>
      {/*//! ============= HERO SECTION START ============= */}
    </>
  );
};

export default Home;
